import { useParams } from "react-router-dom";
function ProductDetails() {
  const params = useParams();
  const id = params.productId;
  return (
    <>
      <h1>Product Details!</h1>
      <p>{params.id}</p>
    </>
  );
}

export default ProductDetails;
